import React, { Component } from 'react'

export class ItemsShow extends Component({props}) {
  render() {
    return (
        <main>
            {this.sta.items.map(el => (
                <h1>{el.title}</h1>
            ))}
        </main>
    )
  }
}

export default ItemsShow;
